var input = `



`;

function calc() {
	var keyboard = ["123", "456", "789"];

	var code = "";

	input.split("\n").forEach(function(line){
		var row = 1;
		var col = 1;
		line.split("").forEach(function(c){
			switch(c) {
			case "U":
				--row;
				break;
			case "D":
				++row;
				break;
			case "L":
				--col;
				break;
			case "R":
				++col;
				break;
			}

			row = Math.min(Math.max(row, 0), 2);
			col = Math.min(Math.max(col, 0), 2);
		});

		code += keyboard[row][col];
	});

	return code;
}
